B.oV=A.a(s(["Ny hetsika kely rehetra dia manan-danja. Na dia ny fihetsika madinika aza dia afaka manampy ny tontolo iainana.","Ampihena, avereno ampiasaina, ary avereno. Miezaha hampihena ny zavatra ariana.","Ny fanamboarana komposta amin'ny sisa sakafo dia afaka mampihena ny fiantraikan'ny toetrandro ary mampihodina ny otrikaina.","Akombony ny paompy rehefa miborosy nify na manaratra mba hamonjy rano.","Ampiasao tavoahangy rano azo averina fenoina fa tsy mividy rano anaty tavoahangy.","Mandehana an-tongotra na mitaingina bisikileta raha azo atao mba hampihena ny dian-tongotra karb\xf4na.","Maniry hazo na mandray anjara amin'ny hetsika fambolen-kazo mba hiadiana amin'ny fiovan'ny toetr'andro.","Ampiasao jiro sy fitaovana mitsitsy angovo mba hampihenana ny fanjifana herinaratra.","Esory amin'ny herinaratra ireo fitaovana elektronika rehefa tsy ampiasaina mba hamonjy angovo sy hampihenana ny faktioran'ny herinaratra.","Vidio ny vokatra avy any an-toerana sy mifanaraka amin'ny vanim-potoana mba hampihenana ny fiantraikan'ny fitaterana.","Atsaharo na amidio ny zavatra tsy ilainao intsony fa aza ariana.","Ampiasao kitapo, mololo ary vata azo ampiasaina indray mba hampihenana ny fako plastika.","Vonoy ny jiro sy ny fitaovana rehefa miala amin'ny efitra iray mba hamonjy angovo.","Mifidiana fitateram-bahoaka na miara-mandeha amin\u2019ny fiara rehefa azo atao mba hampihenana ny dian-tongotra karb\xf4na.","Tohano ireo orinasa izay manome lanja ny faharetana sy ny fanaovana amin'ny fomba sariaka amin'ny tontolo iainana.","Man\xe0na fahalalana sy ampahafantaro ny hafa momba ny olana ara-tontolo iainana sy ny fomba hampihenana ny fiantraikanao.","Manampia amin'ny fikambanana miaro ny tontolo iainana na mandraisa anjara amin'ny hetsika fanadiovana ifotony.","Ampiheno ny fanjifana hena na mifidiana sakafo avy amin\u2019ny zavamaniry mba hampihenana ny dian-tongotra karb\xf4na.","Apetraho ny thermostat azo fandaharana mba hampifanaraka ny hafanana sy ny fampangatsiahana ary hamonjy angovo.","Mifidiana vokatra fanadiovana sariaka amin'ny tontolo iainana na manamboara ny anao mba hampihenana ny fako simika."]),t.s)
