B.Ql=A.a(s(["Un joueur plantant un arbre ou une plante dans son jardin ou un espace public.","Un groupe de personnes participant \xe0 un \xe9v\xe9nement de plantation d'arbres ou de reforestation.","Une photo avant-apr\xe8s de plantation d'arbres ou de restauration d'espace vert.","Des graines ou des jeunes plants pr\xeats \xe0 \xeatre plant\xe9s.","Un arbre r\xe9cemment plant\xe9 avec un tuteur pour le soutenir.","Un joueur arrosant des arbres ou des plantes r\xe9cemment plant\xe9s.","Une p\xe9pini\xe8re remplie de jeunes plants d'arbres.","Un jardin communautaire ou un potager bio.","Un joueur plantant des fleurs sauvages pour promouvoir la biodiversit\xe9.","Un espace vert restaur\xe9 apr\xe8s un incendie ou une catastrophe naturelle.","Des arbres fruitiers plant\xe9s dans un verger ou un jardin.","Un joueur cr\xe9ant un h\xf4tel \xe0 insectes ou un abri pour la faune.","Une haie indig\xe8ne plant\xe9e pour fournir un habitat \xe0 la faune et r\xe9duire l'\xe9rosion.","Un projet de jardinage vertical ou de toit v\xe9g\xe9tal.","Un joueur plantant des plantes indig\xe8nes pour soutenir les \xe9cosyst\xe8mes locaux.","Une for\xeat \xe9tant restaur\xe9e gr\xe2ce \xe0 des efforts de reforestation.","Un joueur participant \xe0 un atelier sur la plantation et l'entretien des arbres.","Une photo illustrant l'importance des arbres et des for\xeats pour la sant\xe9 de la plan\xe8te.","Un projet de jardinage scolaire ou communautaire.","Un joueur plantant des arbres dans le cadre d'un programme de compensation carbone."]),t.s)
B.Rp=A.a(s(["Un joueur utilisant un v\xe9lo, une trottinette ou des rollers comme mode de transport \xe9cologique.","Une photo d'un jardin de l\xe9gumes bio ou d'un compost \xe0 domicile.","Des panneaux solaires ou des \xe9oliennes install\xe9s sur un b\xe2timent ou dans un jardin.","Un joueur utilisant une bouteille d'eau r\xe9utilisable ou un sac en tissu pour faire ses courses.","Une voiture \xe9lectrique ou hybride branch\xe9e sur une station de recharge.","Un joueur utilisant les transports en commun (bus, train, tram) au lieu de conduire.","Une maison \xe9quip\xe9e de syst\xe8mes de chauffage et de climatisation \xe9cologiques (pompe \xe0 chaleur, g\xe9othermie).","Un joueur cuisinant un repas v\xe9g\xe9tarien ou v\xe9g\xe9talien pour r\xe9duire son empreinte carbone.","Des ampoules LED \xe9co\xe9nerg\xe9tiques utilis\xe9es dans une maison ou un bureau.","Un joueur r\xe9parant ou redonnant une nouvelle vie \xe0 des objets au lieu de les jeter.","Un syst\xe8me de r\xe9cup\xe9ration d'eau de pluie install\xe9 pour arroser le jardin.","Un joueur participant \xe0 un \xe9v\xe9nement z\xe9ro d\xe9chet ou sans d\xe9chet.","Une photo illustrant l'importance de r\xe9duire la consommation d'\xe9nergie et d'eau.","Un joueur pratiquant le covoiturage pour r\xe9duire les \xe9missions de CO2.","Une maison ou un bureau \xe9quip\xe9 de dispositifs \xe9conomiseurs d'eau (r\xe9ducteurs de d\xe9bit, toilettes \xe0 faible d\xe9bit).","Un joueur utilisant des produits de nettoyage \xe9cologiques et non toxiques.","Une photo montrant l'utilisation d'appareils \xe9lectroniques \xe9conomes en \xe9nergie (ordinateurs, t\xe9l\xe9phones, t\xe9l\xe9visions).","Un joueur participant \xe0 un atelier sur la vie durable et les pratiques \xe9cologiques.","Une entreprise locale engag\xe9e dans des pratiques commerciales durables et respectueuses de l'environnement.","Un joueur sensibilisant aux probl\xe8mes environnementaux et aux solutions \xe9cologiques dans sa communaut\xe9."]),t.s)
